function tick() {
	"use strict";
	mouseIndex+=3;
	mouseIndex = mouseIndex%360;
	//Camera handler
	if(camMoveTimer>0){
		//up
		if(camMoveIndex == 1){
			camY--;
			if(camMoveTimer>1) {
				characterY += 1
			}
		}
		//down
		if(camMoveIndex == 2){
			if(camMoveTimer>1) {
				characterY -= 1
			}
			camY++;
		}
		//left
		if(camMoveIndex == 3){
			if(camMoveTimer>1) {
				characterX += 1
			}
			camX--;
		}
		//right
		if(camMoveIndex == 4){
			if(camMoveTimer>1) {
				characterX -= 1
			}
			camX++;
		}
		camMoveTimer--;
	}else{
		camMoveIndex = 0;
	}

	//Text Engine Stuff
	if(textTickIndex < maxTextTickIndex){
		textTickIndex++;
	}else {
		if (nextLine != null) {
			if ((steps * maxCharacters) + index <= nextLine.length) {
				PS.statusText(nextLine.substring(steps * maxCharacters, (steps * maxCharacters) + index));
				if (index < maxCharacters) {
					index++;
				} else {
					if(newLineTickIndex < maxnewLineTickIndex){
						newLineTickIndex++;
					}else {
						steps++;
						index = 0;
						newLineTickIndex = 0;
					}
				}
			}else{
				if(coolDownTickIndex < maxCoolDownTickIndex){
					coolDownTickIndex++;
				}else {
					if(colorTextFadeTickIndex < maxColorTextFadeTickIndex){
						colorTextFadeTickIndex++;
						var scaledColor = scaleColor(webColor, (colorTextFadeTickIndex/maxColorTextFadeTickIndex));
						PS.statusColor(scaledColor);
					}else {
						nextLine = "";
						index = 0;
						steps = 0;
						newLineTickIndex = 0;
						coolDownTickIndex = 0;
						PS.statusText("");
						PS.statusColor(PS.COLOR_BLACK);
						colorTextFadeTickIndex = 0;
					}
				}
			}
		}
		textTickIndex = 0;
	}

	//player movement stuff
	if(playerCurTime == playerMaxTime){
		playerCurTime = 0;
		if(playerPathIndex<playerPath.length){
			//check to see if the color isNotWhite
			if((((levels[c])[4])[((playerPath[playerPathIndex])[0] + camX) + (((playerPath[playerPathIndex])[1] + camY) * (levels[c])[1])]) == 0){
				//additional check to see if the player hits a wall
				if(checkWalls((playerPath[playerPathIndex])[0], (playerPath[playerPathIndex])[1]) == true){
					//When you hit a wall
					playerPath = [];
					playerPathIndex = 0;
				}else {
					characterX = (playerPath[playerPathIndex])[0];
					characterY = (playerPath[playerPathIndex])[1];
					//you have moved, now check to see what entities you have hit / are interacting with.
					checkIntersections();
					playerPathIndex++
				}
			}else{
				//When you hit a wall
				playerPath = [];
				playerPathIndex = 0;
			}
			if(playerPathIndex>=playerPath.length){
				//check to see if the player is at an intersection
				if(characterY==0){
					if(camY>0) {
						if(checkSolid(characterX + camX, characterY-1 + camY) == 1){
							return;
						}
						moveCam(1)
					}
				}
				if(characterY==gridSize-1){
					if(camY<(levelHeight-gridSize)) {
						if(checkSolid(characterX + camX, characterY+1 + camY) == 1){
							return;
						}
						moveCam(2)
					}
				}
				if(characterX==0){
					if(camX>0) {
						if(checkSolid(characterX-1 + camX, characterY + camY) == 1){
							return;
						}
						moveCam(3)
					}
				}
				if(characterX==gridSize-1){
					if(camX<(levelWidth-gridSize)) {
						if(checkSolid((characterX + 1 + camX), (characterY + camY)) == 1){
							return;
						}
						moveCam(4)
					}
				}
				//PS.debug("Player:"+characterX+","+characterY+"\n");
			}
		}else{
			//stop the player from moving
			playerPathIndex = 0;
			playerPath = [];
		}
	}else{
		playerCurTime++
	}
	//repaints the screen
	repaint();
	//draw Entities on the screen
};

//Camera stuff
var repaint = function(){
	for(var i = 0; i<gridSize; i++){
		for(var j = 0; j<gridSize; j++){
			//levelSize
			if(camX>=0 && camX<=(levelWidth-gridSize) && camY>=0 && camY<=(levelHeight-gridSize)){
				PS.color(i, j, grayScale(((levels[c])[3])[(i + camX) + ((j + camY) * (levels[c])[1])]));
			}else {
				PS.color(i, j, bgColor);
			}
			PS.border(i,j,0);
		}
	}
	//entity stuff
	for(var i = 0; i< objects.length/7; i++){
		if(objects[(i * 7)+1] == "warp"){
			drawWarp(i);
		}
		if(objects[(i * 7)+1] == "triggerTile"){
			drawTriggerTile(i);
		}
		if(objects[(i * 7)+1] == "clickTile"){
			drawClickTile(i);
		}
		if(objects[(i * 7)+1] == "wall"){
			drawWall(i);
		}
		if(objects[(i * 7)+1] == "image"){
			drawImage(i);
		}
	}
	//
	//player
	drawPixel((characterX), (characterY), PS.COLOR_WHITE);
	drawBorder((characterX), (characterY), 3);
	//solid
	if(debug) {
		for(var i = 0; i<gridSize; i++){
			for(var j = 0; j<gridSize; j++){
				//levelSize
				if(camX>=0 && camX<=(levelWidth-gridSize) && camY>=0 && camY<=(levelHeight-gridSize)){
					if(((levels[c])[4])[(i + camX) + ((j + camY) * (levels[c])[1])] == 1) {
						PS.color(i, j, PS.COLOR_RED);
					}
				}
			}
		}
	}
	drawArrow();
};

var moveCam = function(index){
	if(camMoveTimer==0) {
		camMoveIndex = index;
		camMoveTimer = gridSize;
	}
}

//Level stuff
var loadLevel = function(index){
	for(var i = 0; i< levels.length; i++){
		if((levels[i])[0] == index){
			//load the level
			levelWidth = (levels[i])[1];
			levelHeight = (levels[i])[2];
			//clear before send to process!
			objects = [];
			processObjects((levels[i])[5]);
			c = i;
			repaint();
			return;
		}
	}
}

