var drawArrow = function(){

	var x = mouseX;
	var y = mouseY;

	if(distance(x, y, gridSize/2, gridSize/2) < 1*(gridSize/3)){
		return;
	}

	var color = scaleColor(PS.COLOR_WHITE, Math.sin(mouseIndex/90));
	var dir = 3;

	//1 = up
	//2 = down
	//3 = left
	//4 = right

	if(mouseY > mouseX){
		if(mouseY >= (gridSize - mouseX)){
			dir = 2;
		}else {
			dir = 3;
		}
	}else{
		if(mouseY >= (gridSize - mouseX)){
			dir = 4;
		}else {
			dir = 1;
		}
	}

	if (dir == 1) {
		x = 7;
		y = 2;
		if(checkHasUpper() == true) {
			drawPixel(x, y - 2, color);
			drawPixel(x + 1, y - 2, color);
			drawPixel(x - 1, y - 1, color);
			drawPixel(x - 2, y, color);
			drawPixel(x + 2, y - 1, color);
			drawPixel(x + 3, y, color);
		}
	}

	if (dir == 2) {
		x = 7;
		y = 13;
		if(checkHasLower() == true) {
			drawPixel(x, y + 2, color);
			drawPixel(x + 1, y + 2, color);
			drawPixel(x - 1, y + 1, color);
			drawPixel(x - 2, y, color);
			drawPixel(x + 2, y + 1, color);
			drawPixel(x + 3, y, color);
		}
	}

	if (dir == 3) {
		x = 2;
		y = 7;
		if(checkHasLeft() == true) {
			drawPixel(x - 2, y, color);
			drawPixel(x - 2, y + 1, color);
			drawPixel(x - 1, y - 1, color);
			drawPixel(x, y - 2, color);
			drawPixel(x - 1, y + 2, color);
			drawPixel(x, y + 3, color);
		}
	}

	if (dir == 4) {
		x = 13;
		y = 7;
		if(checkHasRight() == true) {
			drawPixel(x + 2, y, color);
			drawPixel(x + 2, y + 1, color);
			drawPixel(x + 1, y - 1, color);
			drawPixel(x + 1, y + 2, color);
			drawPixel(x, y - 2, color);
			drawPixel(x, y + 3, color);
		}
	}

}

var drawBounds = function(){
	for(var y = 0; y < gridSize; y++) {
		for (var x = 0; x < gridSize; x++) {
			if (distance(x, y, gridSize / 2, gridSize / 2) < 1 * (gridSize / 3)) {
			} else {

				var dir = 0;

				//1 = up
				//2 = down
				//3 = left
				//4 = right

				if (y > x) {
					if (y >= (gridSize - x)) {
						dir = 2;
					} else {
						dir = 3;
					}
				} else {
					if (y >= (gridSize - x)) {
						dir = 4;
					} else {
						dir = 1;
					}
				}

				if (dir == 1) {
					drawPixel(x, y, PS.COLOR_RED);
				}

				if (dir == 2) {
					drawPixel(x, y, PS.COLOR_YELLOW);
				}

				if (dir == 3) {
					drawPixel(x, y, PS.COLOR_GREEN);
				}

				if (dir == 4) {
					drawPixel(x, y, PS.COLOR_BLUE);
				}
			}
		}
	}
}

