var processCommand = function(identifier, data){
	//playDialogue
	if(identifier == "playDialogue"){
		sendToTextEngine(data[0]);
	}
	//playSound
	if(identifier == "playSound"){
		PS.audioPlay(data[0], {path: "audio/"});
	}
	//unlockBit
	if(identifier == "unlockBit"){
		if(data[0] == "red"){
			unlocked[0] = 1;
		}
		if(data[0] == "green"){
			unlocked[1] = 1;
		}
		if(data[0] == "blue"){
			unlocked[2] = 1;
		}
	}
	if(identifier == "removeWall"){
		removeWall(data[0]);
	}
	if(identifier == "removeImage"){
		removeWall(data[0]);
	}
	//pass warps in and stuff
	processObjects([data]);
}

