var canGetTo = function(x, y, xx, yy){
	var data = createSolidMap();
	var checkedNodes = [];
	var nodes = [[x, y]]
	while(nodes.length>0){
		//remvoe last node
		var tmpNode = nodes[nodes.length-1];
		//check win
		if(tmpNode[0] == xx){
			if(tmpNode[1] == yy){
				return true;
			}
		}
		var newNodes = [];
		for(var i = 0; i<nodes.length-1; i++){
			newNodes[i] = nodes[i];
		}
		nodes = newNodes;
		checkedNodes[checkedNodes.length] = tmpNode;

		var up = checkAdjasentUp(tmpNode[0], tmpNode[1], data);
		if(up != null){
			var continu = true;
			for(var i = 0; i<nodes.length; i++) {
				if(nodes[i][0] == up[0] && nodes[i][1] == up[1]){
					continu = false;
					i = nodes.length
				}
			}
			for(var i = 0; i<checkedNodes.length; i++) {
				if(checkedNodes[i][0] == up[0] && checkedNodes[i][1] == up[1]){
					continu = false;
					i = checkedNodes.length
				}
			}
			if(continu == true){
				nodes[nodes.length] = up;
			}
		}

		var down = checkAdjasentDown(tmpNode[0], tmpNode[1], data);
		if(down != null){
			var continu = true;
			for(var i = 0; i<nodes.length; i++) {
				if(nodes[i][0] == down[0] && nodes[i][1] == down[1]){
					continu = false;
					i = nodes.length
				}
			}
			for(var i = 0; i<checkedNodes.length; i++) {
				if(checkedNodes[i][0] == down[0] && checkedNodes[i][1] == down[1]){
					continu = false;
					i = checkedNodes.length
				}
			}
			if(continu == true){
				nodes[nodes.length] = down;
			}
		}

		var left = checkAdjasentLeft(tmpNode[0], tmpNode[1], data);
		if(left != null){
			var continu = true;
			for(var i = 0; i<nodes.length; i++) {
				if(nodes[i][0] == left[0] && nodes[i][1] == left[1]){
					continu = false;
					i = nodes.length
				}
			}
			for(var i = 0; i<checkedNodes.length; i++) {
				if(checkedNodes[i][0] == left[0] && checkedNodes[i][1] == left[1]){
					continu = false;
					i = checkedNodes.length
				}
			}
			if(continu == true){
				nodes[nodes.length] = left;
			}
		}

		var right = checkAdjasentRight(tmpNode[0], tmpNode[1], data);
		if(right != null){
			var continu = true;
			for(var i = 0; i<nodes.length; i++) {
				if(nodes[i][0] == right[0] && nodes[i][1] == right[1]){
					continu = false;
					i = nodes.length
				}
			}
			for(var i = 0; i<checkedNodes.length; i++) {
				if(checkedNodes[i][0] == right[0] && checkedNodes[i][1] == right[1]){
					continu = false;
					i = checkedNodes.length
				}
			}
			if(continu == true){
				nodes[nodes.length] = right;
			}
		}
	}
	return false;
}

var checkAdjasentUp = function(x, y, data){
	if((y - 1) >= 0){
		if(data[x + ((y - 1) * gridSize)] == 0){
			return [x, (y - 1)];
		}
	}
	return null;
}

var checkAdjasentDown = function(x, y, data){
	if((y + 1) < gridSize){
		if(data[x + ((y + 1) * gridSize)] == 0){
			return [x, (y + 1)];
		}
	}
	return null;
}

var checkAdjasentLeft = function(x, y, data){
	if((x - 1) >= 0){
		if(data[(x - 1) + (y * gridSize)] == 0){
			return [(x - 1), y];
		}
	}
	return null;
}

var checkAdjasentRight = function(x, y, data){
	if((x + 1) < gridSize){
		if(data[(x + 1) + (y * gridSize)] == 0){
			return [(x + 1), y];
		}
	}
	return null;
}

var createSolidMap = function() {
	var solidData = [];

	//solids defined by the level solid file
	for (var j = 0; j < gridSize; j++) {
		for (var i = 0; i < gridSize; i++) {
			solidData[i + (j * gridSize)] = checkSolid((i + camX), (j + camY));
			//PS.debug((i+camX)+","+((j+camY)+"\n"));
		}
	}

	//solids for any walls in the scene
	for (var j = 0; j < gridSize; j++) {
		for (var i = 0; i < gridSize; i++) {
			if (solidData[i + (j * gridSize)] == 0) {
				if (checkWalls((i + camX), (i + camX)) == true) {
					solidData[i + (j * gridSize)] = 1;
				}
			}
		}
	}

	return solidData;
}

//this function returns the distance between two points in space using the 2point distance formula.
var distance = function(x, y, xx, yy) {
	return Math.sqrt(Math.pow((x - xx), 2)+Math.pow((y - yy), 2));
};

